import React from 'react'
import List from './ListCategory'

class SideBar extends React.Component{
    
    render() {
        return <div>

            List.map((value,index,list)=>{<div className="col-md-4">
            <label className="checkbox">
                <input type="checkbox"/>
                <span></span>
            </label>
            value
        </div>}
        </div>
    }


}

export default SideBar

